import Navbar from './Navbar'

function Account()
{
    // var name=JSON.parse(localStorage.getItem('name'));
    // var Email=JSON.parse(localStorage.getItem('Email'));
    return(
        <body>
        <header>
        <Navbar/>
    <main>
        <section class="left">
            <img src="D:\react\8.jpg" alt=""></img>
            <form>
                <label>username</label><br></br>
             <input type="range" name=" "placeholder="username"></input><br></br>
               <label>Email</label><br></br>
                {/* <p>{name}</p><br></br> */}
                {/* <p>{Email}</p><br></br> */}
                <button>My orders
                </button><br></br>
                <button>Change password</button>
            </form>
        </section>
    </main>
    <button><span>Upload image</span></button> 
    </header>
    </body>
    )
}

export default Account
